import { StatusBar } from "expo-status-bar";
import {
  StyleSheet,
  Text,
  View,
  TextInput,
  TouchableOpacity,
  Modal,
  ScrollView,
} from "react-native";
import { React, useState, useEffect } from "react";
import CollectionItem from "../components/Collections.js";
import AddCollection from "../components/AddCollection.js";
import AsyncStorage from "@react-native-async-storage/async-storage";

export default function Dashboard({ navigation }) {
  const [showmodal, changeshowmodal] = useState(false);
  const [succreq, succreq_chg] = useState(false);
  const [user_obj, user_obj_chg] = useState(null);

  const [collections, collections_chg] = useState([]);
  let mounted = true;
  const load_collections = async (ids_retreived) =>
    await fetch("http://192.168.0.158:3000/collection/", {
      method: "GET",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: {
        ids: ids_retreived,
      },
    }).then(async (res) => {
      let res_fm = await res.json();
      if (mounted) {
        succreq_chg(true);
        collections_chg(res_fm.data);
      }
    });
  const get_user = async (id_user) =>{
    await fetch("http://192.168.0.158:3000/users/", {
      method: "GET",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: {
        id: id_user,
      },
    }).then(async (res) => {
      console.log(res)
      let response = await res.json();
      console.log(response.message);
      if (response.message == "Success") {
        user_obj_chg(response.data);
        console.log(response.data);
      } else navigation.navigate("Login");
    });
  }
  const storage_userid = async () => {
    try {
      return await AsyncStorage.getItem("@user_id");
    } catch (e) {
      console.log(e);
      return null;
    }
  };
  useEffect(() => {
    storage_userid().then(async (user_id) => {
      if (user_id != null) {
        get_user(user_id).then((ids) => {
          console.log(ids)
          if (ids != null) {
            load_collections(ids);
            return () => (mounted = false);
          }
        }).catch(e=> console.log(e));
      } else navigation.navigate("Login");
    });
  }, []);
  return (
    <View style={styles.container}>
      <Text style={styles.header}>Welcome</Text>
      <Text style={styles.label}>My Collections</Text>
      <ScrollView style={styles.collections}>
        {collections ? (
          collections.map((collection) => {
            return (
              <CollectionItem
                key={collection._id}
                collection={collection}
                navigation={navigation}
                load_collections={load_collections}
              />
            );
          })
        ) : (
          <View>
            {succreq == false ? (
              <Text>
                Your collections failed to load. Please refresh or try again in
                a few minutes.
              </Text>
            ) : (
              <Text>Press on the button below to add a collection</Text>
            )}
          </View>
        )}
        <StatusBar style="auto" />
      </ScrollView>
      <TouchableOpacity
        style={styles.addcoll}
        onPress={() => changeshowmodal()}
      >
        <Text style={styles.addcolltext}>Add Collection</Text>
      </TouchableOpacity>
      <AddCollection
        showmodal={showmodal}
        changeshowmodal={changeshowmodal}
        load_collections={load_collections}
      />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    // backgroundColor: "#11b8f5",
    // justifyContent: "center",
    padding: 20,
    display: "flex",
  },
  header: {
    fontSize: 40,
    fontFamily: "sans-serif-condensed",
    // flex:2,
  },
  label: {
    // marginTop:5,
    fontSize: 18,
    // flex: 0.5,
    fontWeight: "300",
  },
  screens: {
    // flex: 10,
  },
  screen_item: {
    height: 50,
    backgroundColor: "rgba(0,0,0,.5)",
    padding: 2,
    margin: 10,
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    borderRadius: 10,
    // borderBottomColor:"rgba(0,0,0,.5)",
  },
  sub_head: {
    fontSize: 25,
    fontWeight: "500",
    borderRadius: 40,
    // color:"#fff",
  },
  hr: {
    width: "100%",
    height: 1,
    backgroundColor: "#000",
  },
  collections: {
    flex: 9,
    // height:200,
    display: "flex",
    margin: 0,
    flexDirection: "column",
    // marginTop: -250,
    padding: 0,
  },
  addcoll: {
    borderWidth: 1,
    height: 50,
    margin: 5,
    padding: 5,
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    borderRadius: 10,
    backgroundColor: "black",
  },
  addcolltext: {
    color: "white",
    fontSize: 20,
  },
  modalcontainer: {
    height: 50,
    width: 50,
    backgroundColor: "black",
  },
  modalform: {},
});
